import React from 'react';
import { Header } from '../Header'

const layoutStyle = {
    margin: '40px auto',
    padding: '0px 20px',
    maxWidth: 1200,
};

export const Layout = ({ children }) => {
    return (
        <div style={layoutStyle} >
            <Header />
            { children }
        </div>
    );
}
